INSERT INTO @stcmTable (SOURCE_CODE, SOURCE_CONCEPT_ID, SOURCE_VOCABULARY_ID,
  SOURCE_CODE_DESCRIPTION, TARGET_CONCEPT_ID, TARGET_VOCABULARY_ID,
  VALID_START_DATE, VALID_END_DATE, INVALID_REASON)
SELECT c.CONCEPT_CODE AS SOURCE_CODE,
	CAST(fm.MEDDRA_CONCEPT_ID AS INT) AS SOURCE_CONCEPT_ID,
	'MEDDRA_TO_STANDARD' AS SOURCE_VOCABULARY_ID,
	c.CONCEPT_NAME AS SOURCE_CODE_DESCRIPTION,
	CASE WHEN SNOMED_CONCEPT_ID iS NULL THEN 0 ELSE SNOMED_CONCEPT_ID END AS TARGET_CONCEPT_ID,
	SNOMED_VOCABULARY_ID AS TARGET_VOCABULARY_ID,
	'1/1/1970' AS VALID_START_DATE,
	'12/31/2099' AS VALID_END_DATE,
	NULL AS INVALID_REASON--,
	--SNOMED_MAPPING_TYPE, FAERS_DISTINCT_REPORT_TYPES, FAERS_SUM_REPORT
FROM CTE_FINAL_MAP fm
	JOIN @vocabulary.CONCEPT c
		ON CAST(c.CONCEPT_ID AS VARCHAR(100)) = fm.MEDDRA_CONCEPT_ID
ORDER BY FAERS_SUM_REPORT DESC, SOURCE_CODE_DESCRIPTION;

